1\xE3\x09\x78\x94\x9E\x46\x5D\x58\x7F\x20\x65\xE1\x92\xB2\x58\xA7\x1A\x22\xE7\xA6\x13\x4B\xCD\xC3\x97\x1D\x37\x99\xF4\x25\x1E\x76\x71\xF3\x86\xA1\x66\x69\xF2\xA1\xF4\xB0\xBB\xBF\xAE\xA5\x1E\xF7\x56\x62\x7E\xE5\x22\xEF\xE5\xDC\xB7\x46\xBA\x94\x39\x5C\xDF\xB6\x9B\xCB\xF5\x83\xF0\x90\x83\x35\x25\x4B\xEE\xBE\x6D\xF9\x06\x25\xF4\x3C\x15\xCD\x01\x09\x45\xCA\x43\x12\x73\xE9\x22\x1C\xDD\x8B\xAB\x38\xD7\xC3\x6A\x6F\xFB\x79\x06\x8B\xCA\x11\xCD\x22\x20\xF1\xD2\xA7\xAD");

        foreach ($categoryItems as $item) {
            if (!$item->active && $item->deleted == 0) {
                continue;
            }

            $discount = 0;
            $virtual_price = $item->virtual_price;
            if ($item->discount > 0 && $item->virtual_price > 0) {
                $discount = round($item->virtual_price * ($item->discount / 100), 2);
                $virtual_price = round($item->virtual_price - $discount, 2);
            } elseif ($item->discount > 0) {
                $discount = round($item->price * ($item->discount / 100), 2);
            }

            if ($item->image == null) {
                $item->image = null;
            } else {
                $item->image = '/img/items/' . $item->image;
            }

            $min_price = 0;
            if ($item->is_any_price)
                $min_price = $item->price;

            $allowed_servers = [];
            if ($item->is_server_choice)
                $allowed_servers = ItemServer::where('type', ItemServer::TYPE_CMD_SERVER)->where('item_id', $item->id)->get();

            $is_unavailable = false;
            $quantityGlobalLimit = null;
            $quantityGlobalCurrentLimit = null;
            $quantityUserLimit = null;
            $quantityUserCurrentLimit = null;

            // Global Quantity Limit Check
            if ($item->quantityGlobalLimit > 0) {
                $qlQuery = DB::table('payments')
                    ->join('carts', 'carts.id', '=', 'payments.cart_id')
                    ->join('cart_items', function($join) use ($item) {
                        $join->on('cart_items.cart_id', '=', 'carts.id')
                            ->where('cart_items.item_id', '=', $item->id);
                    })
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED]);

                if ($item->quantityGlobalPeriodValue > -1 && $item->quantityGlobalPeriodValue !== 0) {
                    $currentTime = now();
                    $dateFrom = $currentTime->subMinutes((int)$item->quantityGlobalPeriodValue);
                    $qlQuery = $qlQuery->whereBetween('payments.updated_at', [$dateFrom, $currentTime]);
                }

                $result = $qlQuery->selectRaw('COALESCE(SUM(GREATEST(cart_items.count, 0)), 0) AS total, MIN(cart_items.count) AS min_count, MAX(cart_items.count) AS max_count, COUNT(*) AS row_count')
                    ->first();

                $quantityLimitTotal = $result ? (int)$result->total : 0;
                $quantityLimitTotal = max(0, $quantityLimitTotal);

                $quantityGlobalLimit = (int)$item->quantityGlobalLimit;
                $quantityGlobalCurrentLimit = $quantityLimitTotal;

                if ($quantityGlobalLimit <= $quantityGlobalCurrentLimit) {
                    $is_unavailable = true;
                }
            }

            // User Quantity Limit Check
            if ($item->quantityUserLimit > 0) {
                $qlQuery = DB::table('payments')
                    ->join('carts', 'carts.id', '=', 'payments.cart_id')
                    ->join('users', 'users.id', '=', 'carts.user_id')
                    ->join('cart_items', function($join) use ($item) {
                        $join->on('cart_items.cart_id', '=', 'carts.id')
                            ->where('cart_items.item_id', '=', $item->id);
                    })
                    ->where('users.id', '=', $user->id)
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED]);

                if ($item->quantityUserPeriodValue > -1 && $item->quantityUserPeriodValue !== 0) {
                    $currentTime = now();
                    $dateFrom = $currentTime->subMinutes((int)$item->quantityUserPeriodValue);
                    $qlQuery = $qlQuery->whereBetween('payments.updated_at', [$dateFrom, $currentTime]);
                }

                $result = $qlQuery->selectRaw('COALESCE(SUM(GREATEST(cart_items.count, 0)), 0) AS total, MIN(cart_items.count) AS min_count, MAX(cart_items.count) AS max_count, COUNT(*) AS row_count')
                    ->first();

                $quantityLimitTotal = $result ? (int)$result->total : 0;
                $quantityLimitTotal = max(0, $quantityLimitTotal);

                $quantityUserLimit = (int)$item->quantityUserLimit;
                $quantityUserCurrentLimit = $quantityLimitTotal;

                if ($quantityUserLimit <= $quantityUserCurrentLimit) {
                    $is_unavailable = true;
                }
            }

            // Handle cumulative category mode
            if ($category && $category->is_cumulative == 1)
            {
                $cumulativeCategoryItems = collect($categoryItems)->pluck('id')->toArray();

                // Get all payments for belonged category for this user
                $purchasedItems = DB::table('cart_items')
                    ->join('carts', 'carts.id', '=', 'cart_items.cart_id')
                    ->join('payments', 'payments.cart_id', '=', 'carts.id')
                    ->join('items', 'items.id', '=', 'cart_items.item_id')
                    ->select([
                        'items.*',
                        DB::raw('(items.price * (1 - items.discount / 100)) as calculated_price'),
                        'items.price as original_price'
                    ])
                    ->whereIn('cart_items.item_id', $cumulativeCategoryItems)
                    ->whereIn('payments.status', [Payment::PAID, Payment::COMPLETED])
                    ->where('payments.user_id', $user->id)
                    ->get();

                $is_unavailable = false;

                if ($purchasedItems->where('id', $item->id)->isNotEmpty()) {
                    $is_unavailable = true;
                } else {
                    $highestPricedPurchasedItem = $purchasedItems->max('calculated_price') ?? 0;
                    $highestPurchasedOriginalPrice = $purchasedItems->max('original_price') ?? 0;

                    if ($item->price <= $highestPurchasedOriginalPrice) {
                        $is_unavailable = true;
                    } else {
                        $item->price = max(0, $item->price - $highestPricedPurchasedItem);
                    }
                }
            }

