                'custom_price' => $item->is_any_price, // Allow user to enter custom price
                'min_price' => $min_price, // Minimum price for custom price
                'quantityGlobalLimit' => $quantityGlobalLimit ?? null, // Global quantity limit
                'quantityGlobalCurrentLimit' => $quantityGlobalCurrentLimit ?? null, // Current value of global quantity limit
                'quantityUserLimit' => $quantityUserLimit ?? null, // User quantity limit
                'quantityUserCurrentLimit' => $quantityUserCurrentLimit ?? null, // Current value of user quantity limit
                'is_unavailable' => $is_unavailable, // Is item unavailable
                'allow_select_server' => $item->is_server_choice, // Allow user to select server
                'allowed_servers' => $allowed_servers, // Allowed servers
                'virtual_price' => $virtual_price, // Virtual price
                'is_virtual_currency_only' => $item->is_virtual_currency_only, // Is virtual currency only
                'image' => $item->image, // Path to item image
                'featured' => $item->featured, // Is item featured
            ];

